val inputRDD = sc.textFile("README.md")
val pairs = inputRDD.flatMap(l => l.split("\\W+")).map(x => (x.toLowerCase(), 1)).reduceByKey((x,y) => x + y)
val bigWords = pairs.filter{case (k,l) => k.length > 3}
val result = bigWords.takeOrdered(10)(Ordering[Int].reverse.on (_._2)).map{case (x,y) => x}
result.foreach(println)

val propertiesRDD = sc.textFile("properties.nt")
val typesRDD = sc.textFile("types.nt")
//Separamos las lineas de Propiedades de forma (sujeto,List(relacion,predicado)) para poder tener (key,value) y posteriormente poder hacer join
val lineasProp = propertiesRDD.flatMap(l => l.split(" . ").filter(x => x.startsWith("<"))).map(x => x.dropRight(1)).map(x => (x.split(" ")(0),List(x.split(" ")(1),x.split(">")(2)))).map{case(x,y) => if(y(1).contains("http")) (x,List(y(0),y(1) ++">")) else (x,y)}
//Separamos las lineas de Tipos y eliminamos la sintaxis de tipo, de forma que nos queda (sujeto, tipo del sujeto)
val lineasTypes = typesRDD.flatMap(l => l.split(" . ").filter(x => x.startsWith("<"))).map(x => x.replace(" <http://www.w3.org/1999/02/22-rdf-syntax-ns#type>", "").dropRight(1)).map(x => (x.split(" ")(0),x.split(" ")(1)))
//Unimos las keys anteriores para tener (sujeto, List(tipo del sujeto))
val listasTypes = lineasTypes.reduceByKey((x,y) => x ++ " " ++ y).mapValues(x => x.split(" ").toList)
//Hacemos join para tener (sujeto,(List(tipo del sujeto),List(relacion,predicado)))
val union = listasTypes.join(lineasProp)
//Seteamos las (key,value) para que quede (sujeto,List(tipo del sujeto),relacion,predicado)
val cuatrUplas = union.map{case (x,y) => (x,y._1,y._2(0),y._2(1))}
cuatrUplas.collect()foreach(println)
